const styles = theme => ({
    paper: {
      padding: theme.spacing(1,1,1,1),
      elevation: 3,
      width: "27vw",
    },
    formHeader: {
      marginBottom: theme.spacing(3),
    },
    form: {
      margin: theme.spacing(3),
    },
    formText: {
      margin: theme.spacing(2),
    },
    button: {
      marginTop: theme.spacing(2),
    },
  });

export default styles;
